import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import './Home.css'


export class NavigateBar extends Component {
  render() {
    return (
      <div className='background'>
        <nav className='align'>    
        <u >  
            <h3>Train Route Management</h3><br/>
          <li><NavLink to="/routes"><b>To Maintain Routes</b></NavLink></li><br/><br/>
          <li><NavLink to="/trains"><b>To Maintain Trains </b></NavLink></li><br/><br/>
          <li><NavLink to="/station"><b>To Maintain Stations </b></NavLink></li><br/><br/>
          <li><NavLink to="/timeschedule"><b>Train Schedule</b></NavLink></li><br/><br/>
        </u>
        </nav>
      </div>
    )
  }
}

export default NavigateBar
